import React, { Component } from "react";

import { Grid, Row, Col } from "react-bootstrap";

import Sidebar from "../navigation/Sidebar";
import Header from "../navigation/Header";

class NGOGroupView extends Component {
  constructor(props) {
    super(props);
  }
  componentDidMount() {
    console.log(this.props);
  }

  render() {
    const groupInfo = this.props.groupInfo;

    const renderGroupInfo = (name, prop) => {
      return (
        <Row>
          <Col>
            <h3>
              {name}: {prop}
            </h3>
          </Col>
        </Row>
      );
    };
    return (
      <div className="wrapper">
        <Sidebar />
        <div id="main-panel" className="main-panel" ref="mainPanel">
          <Header title="Group Overview" />

          <div>{renderGroupInfo("Group Name", groupInfo.name)}</div>
          <Row>
            <Col>
              <h3>Registration Date: {this.props.groupInfo.regDate}</h3>
            </Col>
          </Row>
          <Row>
            <Col>
              <h3>Currency: {this.props.groupInfo.currency}</h3>
            </Col>
          </Row>
          <Row>
            <Col>
              <h3>Currency: {this.props.groupInfo.currency}</h3>
            </Col>
          </Row>
          <Row>
            <Col>
              <h3>Owner: {this.props.groupInfo.owner}</h3>
            </Col>
          </Row>
          <Row>
            <Col>
              <h3>Admin: {this.props.groupInfo.admin}</h3>
            </Col>
          </Row>
        </div>
      </div>
    );
  }
}

export default NGOGroupView;
